from librosa.feature.utils import delta
import librosa
import librosa.display
import numpy as np


num_audio_files = 10

# Initialize empty lists to store MFCC features, means,  variances
features = []

# Loop to upload, load, and process audio files
for i in range(1, num_audio_files + 1):
    audio_files = f"/content/index_{i}.wav"

    # Load the audio file
    y, sr = librosa.load(audio_files, sr=None)

    # Extract MFCC features
    mfcc = librosa.feature.mfcc(y=y, n_mfcc=13, sr=sr)

    # Calculate mean of MFCC and total mean for each audio file
    mfcc_mean = np.mean(mfcc, axis=1)
    #total_mean = np.mean(mfcc_mean)

    # Calculate variance of MFCC and total variance for each audio file
    mfcc_variance = np.var(mfcc, axis=1)
    #total_variance = np.var(mfcc_variance)

    # Calculate delat of MFCC and the mean of the delta values for each audio file
    mfcc_delta = librosa.feature.delta(mfcc)
    delta_mean = np.mean(mfcc_delta)

    # Calculate delat-delta of MFCC and the mean of the delta-delta values for each audio file
    mfcc_delta_delta = librosa.feature.delta(mfcc, order=2)
    delta_delta_mean = np.mean(mfcc_delta_delta)

    # Append the results to the respective lists (THIS SHOULD BE ONE BIG ARRAY - DOUBLE CHECK)
    feature_vector = np.concatenate((mfcc_mean, mfcc_variance, delta_mean, delta_delta_mean))

    # append to feature list
    features.append(feature_vector)

# Convert the lists of feature vectors to a feature matrix (THIS SHOULD BE A MATRIX that is m_features x n_audio_files)
comprehensive_matrix = np.array(features)

# Print the matrix
print("Comprehensive Matrix:")
print(comprehensive_matrix)

